import React from "react";

const User = ({ user }) => {
  return (
    <div>
      <b>{user.name}</b>
      <span> ({user.email})</span>
    </div>
  );
};

const UserList = () => {
  const users = [
    {
      id: 1,
      name: "sookmyung",
      email: "sookmyung@example.com",
    },
    {
      id: 2,
      name: "mutsa",
      email: "likelionsmwu@example.com",
    },
    {
      id: 1,
      name: "youbin",
      email: "youb@example.com",
    },
  ];

  return (
    <div>
      <User user={users[0]} />
      <User user={users[1]} />
      <User user={users[2]} />
    </div>
  );
};

export default UserList;
